import React, { useState } from 'react';
import ButtonLocation from "./ButtonLocation";
import Header from "./Header";
import Intro from "./Intro";

function Gallery() {
    return (
    <div>
        <Header />
        <Intro name={"Gustavo"} />
        <ButtonLocation onClick={fetchCepData} />
        {cepData && (
        <div className='dados'>
            <div>
                <p>CEP: {cepData.cep}</p>
                <p>CIDADE: {cepData.localidade}</p>
                <p>BAIRRO: {"São Jorge"}</p>
                <p>AVENIDA: {"Honorio Germano"}</p>
                <p>HORÁRIO: {"20:00H"}</p>
            </div>
        </div>
        )}
    </div>
  );
}

export default Gallery;
